import axios from "axios";

export default function List() {

  const [data, setData] = useState(null);
  
  useEffect(() => {
    axios
        .get('https://ghibliapi.herokuapp.com/films')
        .then((res) => {
            console.log(res.data);
            setData(res.data);
            
        })
        .catch((err) => {
            console.log(err);
        }); 
}, []);

      return (
        
        <div className="mt-3">

        { this.state.data.map(data=>

